import React from 'react'
import {Container, Nav, Navbar} from 'react-bootstrap'
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom';
const NavBar = () => {
  return (
    <Navbar  sticky='top' >
      <Container >
        <Navbar.Brand href='#' style={{textDecoration:'none'}}>Get the App </Navbar.Brand>
      <Nav>
        <Nav.Link><Link style={{textDecoration:'none', color:'bl'}} to='/investor-relations'>Investor Relations</Link></Nav.Link>
        <Nav.Link><Link style={{textDecoration:'none'}} to='/add-restaurant'>Add restaurant</Link></Nav.Link>
        <Nav.Link><Link style={{textDecoration:'none'}} to='/login'>Log In</Link></Nav.Link>
        <Nav.Link><Link style={{textDecoration:'none'}} to='/signup'>Sign up</Link></Nav.Link>
      </Nav>
      </Container>
    </Navbar>

  )
}

export default NavBar
